package com.api.beautybook.initialization;

import com.api.beautybook.model.image.Image;
import com.api.beautybook.model.image.ImageRepository;
import com.api.beautybook.model.master_type.MasterType;
import com.api.beautybook.model.master_type.MasterTypeRepository;
import com.api.beautybook.model.service.Service;
import com.api.beautybook.model.service.ServiceRepository;
import com.fasterxml.jackson.databind.ser.Serializers.Base;
import java.util.Base64;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.ApplicationArguments;
import org.springframework.boot.ApplicationRunner;
import org.springframework.stereotype.Component;

@Component
public class StartDataInitializer implements ApplicationRunner {

  private final MasterTypeRepository masterTypeRepository;
  private final ServiceRepository serviceRepository;
  private final ImageRepository imageRepository;

  @Autowired
  public StartDataInitializer(MasterTypeRepository masterTypeRepository,
      ServiceRepository serviceRepository, ImageRepository imageRepository) {
    this.masterTypeRepository = masterTypeRepository;
    this.serviceRepository = serviceRepository;
    this.imageRepository = imageRepository;
  }

  @Override
  public void run(ApplicationArguments args) throws Exception {

    byte[] i1Content = Base64.getDecoder().decode("");
    byte[] i2Content = Base64.getDecoder().decode("");

    Image i1 = new Image(null, i1Content);
    Image i2 = new Image(null, i2Content);

    i1 = imageRepository.save(i1);
    i2 = imageRepository.save(i2);

    MasterType mt1 = new MasterType(null, "Перукар", i1);
    MasterType mt2 = new MasterType(null, "Майстер нігтьового сервісу", i2);

    mt1 = masterTypeRepository.save(mt1);
    mt2 = masterTypeRepository.save(mt2);

    Service s1 = new Service(null, "Стрижка", mt1);
    Service s2 = new Service(null, "Френч", mt2);

    s1 = serviceRepository.save(s1);
    s2 = serviceRepository.save(s2);

    System.out.println("Initial master types initialization...");
    System.out.println(mt1);
    System.out.println(mt2);

    System.out.println("Initial services initialization...");
    System.out.println(s1);
    System.out.println(s2);

    System.out.println("Initialization is complete.");
  }
}
